import { useState } from "react";

function App() {

  const [searchTerm, setsearchTerm] = useState('')

  const onSearchChange = (e) => {
    setsearchTerm(e.value.target)
  }

  return (
    <div className="App">
         <form>
           <label>Search: </label>
           <input value={searchTerm} onChange={setsearchTerm}/>
         </form>
    </div>
  );
}

export default App;
